import React from 'react';

import { Link } from 'react-router-dom';


function About() {
    return (
        <div>
            <h1><font size="10" color="yellow">About</font></h1>
            <p><font size="10" color="yellow">This is a Pokédex app built using React and the PokéAPI. It allows trainers to browse and learn more about different Pokémon.</font></p>

            <p>
                <Link to="/home">Go to the home page</Link>
            </p>
        </div>
    );
}

export default About;


